import React from "react";

const ColorDetection = ({ imageUrl, colors }) => {

    const test = document.getElementById('color3')
    if (colors.length > 3) {
        test.setAttribute({hidden: 'true'});
    }

    return (
        <div className="flex justify-center mt-36 max-h-1/2">
            <div>
                {/* image container */}
                <div>
                    <img src={imageUrl} alt="" className="rounded" width={'500px'} height={'auto'} />
                </div>
                {/* color container */}
                <div className="flex justify-between mt-5 h-20">
                    {/* 1 */}
                    <div className="w-full flex flex-col justify-between" id="color1">
                        {/* color */}
                        <div style={{backgroundColor: colors[0]}} className="h-full rounded"></div>
                    </div>
                    {/* 2 */}
                    <div className="w-full flex flex-col justify-between" id="color2">
                        {/* color */}
                        <div style={{backgroundColor: colors[1]}} className="h-full rounded"></div>
                    </div>
                    {/* 3 */}
                    <div className="w-full flex flex-col justify-between" id="color3">
                        {/* color */}
                        <div style={{backgroundColor: colors[2]}} className="h-full rounded" hidden={false}></div>
                    </div>
                    {/* 4 */}
                    <div className="w-full flex flex-col justify-between" id="color4">
                        {/* color */}
                        <div style={{backgroundColor: colors[3]}} className="h-full rounded"></div>
                    </div>
                    {/* 5 */}
                    <div className="w-full flex flex-col justify-between" id="color5">
                        {/* color */}
                        <div style={{backgroundColor: colors[4]}} className="h-full rounded"></div>
                    </div>
                </div>
            </div>
        </div>
    )
}


export default ColorDetection;
